    color: '#fff',
    lineHeight: '160px',
    textAlign: 'center',
    background: '#364d79',
};

export default class Movie extends Component {
    render() {
        return (
            <div>
                <Card>
                    <Carousel />
                </Card>
            </div>
        )
    }
}
